    "#Bar plot based on each species\n",
    "plt.figure(figsize=(10, 6))\n",
    "sns.barplot(data=iris_data, x='species', y=iris_data.index, palette='PuBu')\n",
    "plt.title('Species Distribution')\n",
    "plt.xlabel('Species')\n",
    "plt.ylabel('Count')\n",
    "plt.show()\n"
